// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

library BLS12381G2 {
    function g2MulEncoded(bytes calldata g2Point256, uint256 scalar) internal view returns (bytes memory out) {
        require(g2Point256.length == 256, "point must be 256 bytes");

        bytes memory input = new bytes(288);
        out = new bytes(256);

        assembly {
            // copy point(256) into input[0..255]
            calldatacopy(add(input, 0x20), g2Point256.offset, 256)

            // store scalar at input[256..287]; pointer = input + 0x20 + 0x100 = input + 0x120
            mstore(add(input, 0x120), scalar)

            // call precompile 0x0e (BLS12_G2MSM), input len 288, output len 256
            let ok := staticcall(gas(), 0x0e, add(input, 0x20), 288, add(out, 0x20), 256)
            if iszero(ok) { revert(0, 0) }
        }
    }
}

contract TestG2Mul {
    function g2Mul(bytes calldata g2Point256, uint256 s) external view returns (bytes memory) {
        return BLS12381G2.g2MulEncoded(g2Point256, s);
    }
}

